import { Accordion, Button, Container, Col, Row } from "react-bootstrap";

function Todo({ todo, key, index, remove }) {
  function handle() {
    remove(index);
  }
  return (
    <Accordion>
      <Accordion.Item >
        <Accordion.Header>
          <Container>
            <Row>
              <Col>
                <h2>{todo.title}</h2>
              </Col>
              <Col>
                <Button variant="outline-dark" onClick={handle}>
                  Delete
                </Button>
              </Col>
            </Row>
          </Container>
        </Accordion.Header>

        <Accordion.Body>{todo.description}</Accordion.Body>
      </Accordion.Item>
